'use strict';

(function () {
  // Quick DOM node selector
  var $ = function $(selector) {
    selector = selector || null;

    return selector[0] === '#' ? [document.getElementById(selector.substring(1, selector.length))] : [].slice.call(document.querySelectorAll(selector));
  };

  $.extend = function (obj) {
    var _this = this,
        i = undefined;
    if (arguments.length > 2) {
      return Error('$.extend expects at most 2 arguments. Old object and New object');
    }
    if (arguments.length > 1) {
      _this = arguments[0];
      obj = arguments[1];
    }

    for (i in obj) {
      if (obj.hasOwnProperty(i)) {
        _this[i] = obj[i];
      }
    }

    return _this;
  };

  // Add AJAX to the node selector's prototype.
  $.ajax = function (options, callback) {
    if (!options) {
      throw new Error('Options must be passed in!');
    }
    if (!options.url) {
      throw new Error('URL Required');
    }
    if (!callback) {
      throw new Error('Callback required');
    }
    if (typeof callback !== 'function') {
      throw new Error('Callback needs to be a function');
    }
    var xhr = new XMLHttpRequest();

    options.type = options.type || 'GET';
    options.returnJSON = options.returnJSON || false;

    xhr.onreadystatechange = function (event) {
      if (xhr.readyState !== 4) {
        return;
      }

      if (xhr.status === 200) {
        if (options.returnJSON) {
          try {
            var ret = JSON.parse(xhr.response);

            return callback(null, ret);
          } catch (e) {}
        }

        return callback(null, xhr.response);
      } else {
        return callback(xhr);
      }
    };

    xhr.open(options.type, options.url);
    xhr.send();
  };

  window['$'] = $;
})();

document.addEventListener('DOMContentLoaded', function () {
  var storageDump = $.storage.dump();

  // Lines 5 - 16 are setting up our state.
  // base view count
  // disable button
  // then load content.
  if (!storageDump.viewCount) {
    $.storage.set({
      viewCount: 10
    });
  }

  if (storageDump.disableButton) {
    $('.js-loadMore').forEach(function (el) {
      el.className += ' disabled';
      el.setAttribute('disabled', 'disabled');
    });
  }

  if (storageDump.sortBy) {
    $('[data-sortby=' + storageDump.sortBy + '][data-sortalgo=' + storageDump.sortAlgo + ']').forEach(function (el) {
      el.className += ' sorted';
    });
  }

  if (storageDump.loadedArticles) {
    return printFromLoaded();
  }

  return $.ajax({
    url: 'get/more?file=articles.json',
    returnJSON: true
  }, function (err, data) {
    $.storage.set({
      loadedArticles: data
    });

    return printFromLoaded();
  });
});

(function () {
  var allLoaded = false;

  var addMore = function addMore(event) {
    var loadedArticles = $.storage.get('loadedArticles'),
        articleCount = loadedArticles.length,
        viewCount = $.storage.get('viewCount'),
        newCount = viewCount + 10;

    if (newCount === articleCount && allLoaded) {
      event.target.className += ' disabled';
      event.target.setAttribute('disabled', 'disabled');
      $.storage.set({ disableButton: true });
    }

    if (newCount > articleCount && !allLoaded) {
      return $.ajax({ url: 'get/more?file=more-articles.json', returnJSON: true }, function (err, data) {
        if (err) {
          return console.error(err);
        }

        allLoaded = true;
        loadedArticles.push(data);
        loadedArticles = [].concat.apply([], loadedArticles);

        $.storage.set({ loadedArticles: loadedArticles, viewCount: newCount });
        return printFromLoaded();
      });
    }

    $.storage.set({ viewCount: newCount });
    return printFromLoaded();
  };
  $('.js-loadMore').forEach(function (el) {
    el.addEventListener('click', addMore);
  });
})();

(function ($) {
  $.extend({
    parseHTML: function parseHTML(element, obj) {
      element = element[0] || null;
      obj = obj || null;
      if (!element || !obj) {
        return '';
      }

      var source = element.innerHTML,
          template = Handlebars.compile(source),
          htmlStr = template(obj);

      return htmlStr;
    }
  });
})($);

(function () {
  window.printFromLoaded = function () {
    var loaded = $.storage.get('loadedArticles'),
        sortBy = $.storage.get('sortBy'),
        sortAlgo = $.storage.get('sortAlgo'),
        viewCount = $.storage.get('viewCount'),
        tableNodes = $('.data-table__body'),
        unpubCount = $('.data-table__count'),
        source = loaded.slice(0, viewCount),
        html = '';

    if (sortBy && sortAlgo) {
      source = source.sort(function (a, b) {
        if (sortBy === 'words') {
          if (sortAlgo === 'asc') {
            return a[sortBy] - b[sortBy];
          }

          return b[sortBy] - a[sortBy];
        }

        if (sortAlgo === 'asc') {
          return moment(a[sortBy]).format('x') - moment(b[sortBy]).format('x');
        }

        return moment(b[sortBy]).format('x') - moment(a[sortBy]).format('x');
      });
    }

    html = $.parseHTML($('#table-rows'), source);

    tableNodes.forEach(function (el) {
      el.innerHTML = html;
    });

    unpubCount.forEach(function (el) {
      el.innerHTML = '(' + loaded.length + ')';
    });
  };
})();

'use strict';

(function ($) {
  var sortClick = function sortClick(elem) {
    var nodes = $('.js-sort'),
        sortby = elem.getAttribute('data-sortby'),
        algo = elem.getAttribute('data-sortalgo');

    nodes.forEach(function (el) {
      el.className = el.className.replace(/sorted/, '');
    });

    elem.className += ' sorted';

    $.storage.set({
      sortBy: sortby,
      sortAlgo: algo
    });

    return printFromLoaded();
  };

  var nodes = $('.js-sort');
  nodes.forEach(function (el) {
    el.addEventListener('click', function (event) {
      return sortClick(el);
    });
  });
})($);

'use strict';
(function ($) {
  $.extend({
    storage: {
      get: function get(key) {
        var storageObj = JSON.parse(localStorage.getItem('micunpub')) || {};
        // return all if no key is set
        if (!key) {
          return storageObj;
        }

        return storageObj[key] || null;
      },
      set: function set(obj) {
        obj = obj || {};
        //for the purpose of this app, we are using one key with a JSON Object
        obj = JSON.stringify($.extend($.storage.get(), obj), null, 0);
        localStorage.setItem('micunpub', obj);
      },
      dump: function dump() {
        return $.storage.get();
      },
      empty: function empty() {
        return localStorage.clear();
      }
    }
  });
})($);

'use strict';

Handlebars.registerHelper('timeSince', function (date) {
  return moment(date).fromNow();
});